@dashesy, thanks for bringing up this optimization. In your example above, **t2** is much faster than creating **t1**.

However, if **t1** is modified, it doesn't modify **data**, because the contents are copied into a backing buffer.

If **t2** is modified,  **data** is updated well, since they point to the same buffer. This could be a source of confusion for users.

@shahasad , any thoughts? Alternatively, we can add new API to create tensors which "wrap" the original buffer. The performance gains seem to justify it, and the code changes would be minimal.
